import {
    TRADING_DATA_REQUEST,
    TRADING_DATA_SUCCESS,
    TRADING_DATA_FAIL,

    TRADING_CHART_REQUEST,
    TRADING_CHART_SUCCESS,
    TRADING_CHART_FAIL,

    WALLET_INFO_REQUEST,
    WALLET_INFO_SUCCESS,
    WALLET_INFO_FAIL,
    
    TRADING_START_REQUEST,
    TRADING_START_SUCCESS,
    TRADING_START_FAIL
} from '../constants/tradingConstants'

export const tradingBotReducer = (state = { botData : {} }, action) => {
    switch (action.type) {
        case TRADING_DATA_REQUEST:
            return { loading: true, ...state,  id: action.id }

        case TRADING_DATA_SUCCESS:
            return {
                loading: false, botData: action.payload, id: action.id
            }

        case TRADING_DATA_FAIL:
            return { loading: false, error: action.payload, id: action.id}

        default:
            return state
    }
}

// Chart data
export const tradingBotChartReducer = (state = { botChart : {} }, action) => {
    switch (action.type) {
        case TRADING_CHART_REQUEST:
            return { loading: true, ...state,  idParams: action.idParams }

        case TRADING_CHART_SUCCESS:
            return {
                loading: false, botChart: action.payload, idParams: action.idParams
            }

        case TRADING_CHART_FAIL:
            return { loading: false, error: action.payload, idParams: action.idParams}

        default:
            return state
    }
}

export const walletInfoReducer = (state = { wallet: {} }, action) => {
    switch (action.type) {
        case WALLET_INFO_REQUEST:
            return { loadingWallet: true, ...state}

        case WALLET_INFO_SUCCESS:
            return {
                loadingWallet: false, wallet: action.payload
            }

        case WALLET_INFO_FAIL:
            return { loadingWallet: false, error: action.payload}

        default:
            return state
    }
}

export const tradingStartReducer = (state = { response: {} }, action) => {
    switch (action.type) {
        case TRADING_START_REQUEST:
            return { loadingStart: true, ...state}

        case TRADING_START_SUCCESS:
            return {
                loadingStart: false, response: action.payload
            }

        case TRADING_START_FAIL:
            return { loadingStart: false, error: action.payload}

        default:
            return state
    }
}
